import React, { Component } from 'react';
import Head from '../components/Head';

export default class Classes extends Component {
	render() {
		return (
			<div>
				<Head />
				<table>
					<thead>
						<tr>
							<td>name</td>
							<td>password</td>
							<td>\'class\'</td>
						</tr>
					</thead>
					<tbody>
						{this.state.students.map((stud)=><tr  key={stud.id}>
							<td>{stud.name}</td>
							<td>{stud.password}</td>
							<td>{stud.class}</td>
						</tr>)}
						</tbody>
				</table>
			</div>
		);
	}
}
